style.css:
/* i really want this to be global */
 
 
  body
  {
    background: transparent !important;
  }

  .content
  {
    background: transparent !important;
  }

  #fb-root
  {
    width: 100% !important;
    height: 100% !important;
    position: fixed !important;
    background-image: url(https://media.discordapp.net/attachments/862064271243214879/929052698962186320/941459a4d50222257145dcca56300137.gif) !important;
      /* Background */
    background-size: cover !important;
    background-attachment: fixed !important;
  }

  .dark-theme .section-content
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tab .rbx-tab-heading
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tabs-horizontal .nav-tabs
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tabs-horizontal .rbx-tab.active .rbx-tab-heading
  {
    color: #fff;
    background-color: transparent;
    box-shadow: inset 0 -4px 0 0 #000;
  }

  .dark-theme .text, .dark-theme .text-date-hint, .dark-theme .text-default, .dark-theme .text-description, .dark-theme .text-footer, .dark-theme .text-info, .dark-theme .text-label, .dark-theme .text-secondary, .dark-theme p
  {
    color: #ffffff;
  }

  .dark-theme .profile-avatar-right .profile-avatar-mask
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .profile-avatar-left .enable-three-dee
  {
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    border: 1px solid black;
    background-color: #ffffff00;
    border-color: #000000;
    color: #000000;
    cursor: pointer;
    display: inline-block;
    font-weight: 500;
    height: auto;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    padding: 9px 9px;
    font-size: 16px;
    line-height: 100%;
    border-radius: 1px;
    border: 1px solid #000000;
    position: absolute;
    top: 12px;
    right: 12px;
    min-height: 32px;
  }
